        return sorted(p.stem for p in ns_path.glob("*.json"))

    def _path(self, namespace: str, key: str) -> Path:
        safe_namespace = namespace.replace("/", "-")
        safe_key = key.replace("/", "-")
        return self.root / safe_namespace / f"{safe_key}.json"
